import React, { Component } from 'react';
import './App.css';
import {inject, observer} from 'mobx-react';
import Todo from "./component/todo.js";
import Add from "./component/add";

@inject('myHouseApp')
@observer

class App extends Component {

  constructor(props) {
    super(props);
    props.myHouseApp.listHouses();
    this.state = {
      checkStatus: true
    }
    this.handleCheck = this.handleCheck.bind(this);
  }



  render() {
    const {myHouseApp} = this.props;

    const elements = myHouseApp.output.houses.map((item, key)=> 
      <Todo key={key} index={key} item={JSON.stringify(item)} />
    )

    return (

      <div className="App">
        <h1>My House List</h1>

        <div className="tabs">
          <div className="getFrame tab">
            <input type="radio" id="tab-1" name="tab-group-1" checked/>
            <label for="tab-1" className="head">GET</label>

            <div className="get content">
              <ul>
                {elements}
              </ul>
            </div>
          </div>

          <div className="postFrame tab">
            <input type="radio" id="tab-2" name="tab-group-1"/>
            <label for="tab-2" className="head">POST</label>

            <div className="post content">
              <Add
                addNewTodo = {myHouseApp.addNewTodo}
              />
            </div>
          </div>
        </div>  
      </div>
    );
  }
}

export default App;
